import React from "react";

export const SearchForm = () => {

    return (
        <>
        <div className="film-search__form">
        <input
                id="film-search"
                className="search-film__input"
                name="film-search"
                type="search"
            />
          <button className="film-search__-button" type="submit"></button>
        </div>
        </>
    );
};
